import React from "react";
import { Link, useNavigate } from "react-router-dom";

const Navbar = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem("token");
    localStorage.removeItem("role");
    navigate("/login");
  };

  return (
    <nav className="bg-gray-900 text-white py-4 shadow-lg">
      <div className="container mx-auto flex justify-between items-center px-6">
        <Link to="/" className="text-2xl font-bold text-yellow-400">Food Delivery</Link>
        <div className="space-x-6">
          <Link to="/customer-dashboard" className="hover:text-yellow-400 transition">Customer</Link>
          <Link to="/restaurant-dashboard" className="hover:text-yellow-400 transition">Restaurant</Link>
          <Link to="/super-admin-dashboard" className="hover:text-yellow-400 transition">Admin</Link>
          <button onClick={handleLogout} className="bg-red-500 px-4 py-2 rounded-md hover:bg-red-700 transition">
            Logout
          </button>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
